SELECT DISTINCT ?film ?jimjones ?film_label_en ?film_label WHERE {
  {
    BIND( fb:m.03f2xf1 AS ?jimjones ) ?appearance fb:film.personal_film_appearance.person fb:m.03f2xf1 .
    ?appearance fb:film.personal_film_appearance.film ?film .
  } UNION {
    BIND( fb:m.01gkdz AS ?jimjones ) fb:m.01gkdz fb:film.film_subject.films ?film .
  }
  OPTIONAL {
    ?film rdfs:label ?film_label .
  }
  OPTIONAL {
    ?film rdfs:label ?film_label_en FILTER ( lang( ?film_label_en ) = "en" )
  }
}

